import React from "react";
import "./App.css";
import Images from "./Images";
import Search from "./Search";


function App() {
   new IconPatterns(document.getElementbyID("target"), {
     color: "#FFFFFF",
     icons: {
       "ion-icon-library-outline": {
         count: 10,
         sizeVariation: [10, 20],
       },
       "<ion-icon-pencil-outline": {
         count: 10,
         sizeVariation: [5, 15],
       },
       "<ion-icon-search-outline": {
         count: 15,
         sizeVariation: [10, 25],
       },
     },
   }).draw();

  return (
    <div className="Dictionary" id="target">

      <h1>Dictionary</h1>
      <p>What word would you like to look up?</p>
      <Search defaultWord="ram" />
      <Images />
      <p>
        Created & Open-Sourced by Tasia Ledet on{" "}
        <a
          href="https://github.com/tasialedet/tcodes-dictionary"
          target="blank"
        >
          Github
        </a>{" "}
        & Hosted on{" "}
        <a href="https://objective-kepler-9b99bd.netlify.app" target="blank">
          Netlify
        </a>
      </p>
    </div>
  );
}

export default App;
